build: Fix compiler warnings using python2.7

Fix compiler warnings when using python2.7
_POSIX_C_SOURCE and _XOPEN_SOURCE macros are defined in python header.

/usr/include/python2.7/pyconfig-64.h:1191:0: error: "_POSIX_C_SOURCE" redefined [-Werror]
 #define _POSIX_C_SOURCE 200112L
 ^
In file included from /usr/include/inttypes.h:25:0,
                 from /home/uftrace/libmcount/mcount.h:12,
                 from /home/uftrace/utils/script.h:11,
                 from /home/uftrace/utils/script.c:13:
/usr/include/features.h:168:0: note: this is the location of the previous definition
 # define _POSIX_C_SOURCE 200809L
 ^
In file included from /usr/include/python2.7/pyconfig.h:6:0,
                 from /usr/include/python2.7/Python.h:8,
                 from /home/uftrace/utils/script-python.h:18,
                 from /home/uftrace/utils/script.h:13,
                 from /home/uftrace/utils/script.c:13:
/usr/include/python2.7/pyconfig-64.h:1213:0: error: "_XOPEN_SOURCE" redefined [-Werror]
 #define _XOPEN_SOURCE 600
 ^
In file included from /usr/include/inttypes.h:25:0,
                 from /home/uftrace/libmcount/mcount.h:12,
                 from /home/uftrace/utils/script.h:11,
                 from /home/uftrace/utils/script.c:13:
/usr/include/features.h:170:0: note: this is the location of the previous definition
 # define _XOPEN_SOURCE 700
 ^

Fixed: https://github.com/namhyung/uftrace/issues/1276

Signed-off-by: Michelle Jin <shjy180909@gmail.com>

test: Add a test case for EH with static locals

A new test case is to throw an exception during the static local
variable initialization in order to check guard variable behavior.

    $ uftrace tests/t-exception5
    # DURATION     TID     FUNCTION
                [289342] | main() {
                [289342] |   f() {
       1.867 us [289342] |     __cxa_guard_acquire();
                [289342] |     A::A() {
       1.739 us [289342] |       __cxa_allocate_exception();
       1.336 us [289342] |       __cxa_guard_abort();
      69.934 us [289342] |     } /* A::A */
       1.085 us [289342] |     __cxa_guard_release();
      77.687 us [289342] |   } /* f */
      78.594 us [289342] | } /* main */

Signed-off-by: Namhyung Kim <namhyung@gmail.com>

symbol: Add elf_retry() to use debug info if possible

Modern distros provide separate debug packages for system binaries.
As it added the separate debug file support, it can also use it to find
symbol table of the binary too.  And with the debug info, it can support
argument and return values.

The below is an example to use dynamic tracing for the nproc binary and
to show automatic argument/return values.

  $ uftrace -a -P. --no-libcall nproc
  8
  # DURATION     TID     FUNCTION
              [2450185] | main(1, 0x7ffce57b5ec8) {
   143.049 us [2450185] |   set_program_name("nproc");
     0.769 us [2450185] |   atexit();
              [2450185] |   num_processors(NPROC_CURRENT_OVERRIDABLE) {
     0.194 us [2450185] |     parse_omp_threads("NULL") = 0;
     0.059 us [2450185] |     parse_omp_threads("NULL") = 0;
     4.007 us [2450185] |   } = 8; /* num_processors */
   330.818 us [2450185] | } = 0; /* main */
              [2450185] | close_stdout() {
              [2450185] |   close_stream(&_IO_2_1_stdout_) {
              [2450185] |     rpl_fclose(&_IO_2_1_stdout_) {
     0.507 us [2450185] |       rpl_fflush(&_IO_2_1_stdout_) = 0;
     2.621 us [2450185] |     } = 0; /* rpl_fclose */
     3.535 us [2450185] |   } = 0; /* close_stream */
              [2450185] |   close_stream(&_IO_2_1_stderr_) {
              [2450185] |     rpl_fclose(&_IO_2_1_stderr_) {
     0.113 us [2450185] |       rpl_fflush(&_IO_2_1_stderr_) = 0;
     0.704 us [2450185] |     } = 0; /* rpl_fclose */
     0.911 us [2450185] |   } = 0; /* close_stream */
     4.907 us [2450185] | } /* close_stdout */

Signed-off-by: Namhyung Kim <namhyung@gmail.com>

test: Add a test case for octal argument format

This test is to check whether octal format is printed well.
It includes system call functions that take a mode_t argument.

    $ uftrace -F main -a t-arg-oct
    # DURATION     TID     FUNCTION
                [1630269] | main() {
      87.371 us [1630269] |   creat("bar.foo", 0755) = 4;
       3.990 us [1630269] |   chmod("bar.foo", 0777) = 0;
       4.540 us [1630269] |   unlink("bar.foo") = 0;
      97.791 us [1630269] | } /* main */

Signed-off-by: Dongjin Na <dongjinna@gmail.com>
